import style from "./footerFromZesty.module.css";

function FooterFromZesty({ footerTemplateUrl }) {
  return <iframe className={style.iframe} src={footerTemplateUrl}></iframe>;
}

export async function getStaticProps() {
  const html = await app.renderToHTML(
    "https://123fmhwq-dev.preview.zesty.io/footer/"
  );
  return {
    props: {
      footerTemplateUrl: html,
    },
  };
}

export default FooterFromZesty;
